// import logo from './logo.svg';
import './App.css';
import Home from './components/Home';
import About from './components/About';
import Contacts from './components/Contacts';
import {BrowserRouter, Routes, Route, NavLink} from 'react-router-dom';
function App() {
  return (
    <BrowserRouter>
      <div className="wrapper">
        <nav className="menu">
          <NavLink className={({isActive}) => isActive ? "menuLinkActive" : ""} to="/">Home</NavLink>
          <NavLink className={({isActive}) => isActive ? "menuLinkActive" : ""} to="/news">N</NavLink>

          <NavLink className={({isActive}) => isActive ? "menuLinkActive" : ""} to="/about">About</NavLink>
          <NavLink className={({isActive}) => isActive ? "menuLinkActive" : ""} to="/contacts">Contacts</NavLink>
        </nav>
        <Routes>
          <Route path='/' element={<Home />}/>
          <Route path='/about' element={<About />}/>
          <Route path='/contacts' element={<Contacts />}/>

        </Routes>
      </div>
    </BrowserRouter>)}  
export default App;
